import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginRegister from './pages/LoginRegister';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={LoginRegister} />
      </Switch>
    </Router>
  );
}

export default App;
